    false,nt"url": null,nt"notes": "Data submitted by Dr. Gerald L. Engels.
    The data was collected betweennJune 1976 and September 1976. This study was organized
    to collectnHistopathology and Benthic data. SST, wave, turbidity, gear type (trawlnv.s
    dredge), benthic species counts and weights were collected. Thesendata are "megabenthic"
    species. The documentation describes instrumentsnemployed for sampling, units, and
    a detailed description of the recordnformat. The original data on tape has been
    converted to current NODCnstorage format. These studies were part of the Mid-Atlantic
    OuternContinental Shelf Studies (OCS). These data were collected by thenVirginia
    Institute of Marine Science (VIMS).",nt"license_title": null,nt"extras":
